INSERT INTO `platillos` (`Id_Platillo`, `Nombre_Platillo`, `Precio_Platillo`, `Id_Categoria`, `Foto_Platillo`, `Descripcion_Platillo`, `ventas`, `Estado`) VALUES
(1, 'Bandeja Paisa', 15000, 2, , 'La bandeja paisa es el plato típico de la región de Antioquia, Colombia. Este plato colombiano se caracteriza por su abundancia; por eso no se llama plato paisa, pues no entraría en un plato sino \"bandeja\" paisa, porque se requiere una bandeja para que entre. Este plato estuvo delicioso, lo disfruté', '50', 'Vigente');
INSERT INTO `platillos` (`Id_Platillo`, `Nombre_Platillo`, `Precio_Platillo`, `Id_Categoria`, `Foto_Platillo`, `Descripcion_Platillo`, `ventas`, `Estado`) VALUES
(2, 'Mejillones a la Crema', 12500, 1, , 'Los mejillones a la crema, moules à la crème, son uno de los platos más típicos que puedes encontrar por todas partes en Normandía y te lo traemos del otro lado del mundo a nuestro restaurante para que lo disfrutes.', '100', 'Disponible');
INSERT INTO `platillos` (`Id_Platillo`, `Nombre_Platillo`, `Precio_Platillo`, `Id_Categoria`, `Foto_Platillo`, `Descripcion_Platillo`, `ventas`, `Estado`) VALUES
(3, 'Lechona', 8000, 2, , 'La deliciosa lechona es un plato típico de la región del Tolima y Huila. Este plato esta hecho con carne de cerdo, arvejas y arroz principalmente. Es servido con arepas de maíz blanco y una variedad de natilla que localmente se conoce como \"insulso\". Lechona, arveja, manteca de cerdo, cebolla larga.', '80', 'Disponible');
INSERT INTO `platillos` (`Id_Platillo`, `Nombre_Platillo`, `Precio_Platillo`, `Id_Categoria`, `Foto_Platillo`, `Descripcion_Platillo`, `ventas`, `Estado`) VALUES
(5, 'Jugos Naturales', 3000, 4, , 'Deleitate con nuestros mejores jugos 100% naturales preaprados para darte la mejor sensacion en tu paladar.', '45', 'Vigente');
INSERT INTO `platillos` (`Id_Platillo`, `Nombre_Platillo`, `Precio_Platillo`, `Id_Categoria`, `Foto_Platillo`, `Descripcion_Platillo`, `ventas`, `Estado`) VALUES
(6, 'Tarta de Manzana', 10600, 5, , 'La deliciosa tarta de manzana es un clásico que nunca pasa de moda; es que realmente cualquier tipo de receta de tarta de manzana queda bien y en nuestro restaurante encontraras una de las mejores tartas de manzana.', '90', 'Vigente');
INSERT INTO `platillos` (`Id_Platillo`, `Nombre_Platillo`, `Precio_Platillo`, `Id_Categoria`, `Foto_Platillo`, `Descripcion_Platillo`, `ventas`, `Estado`) VALUES
(7, 'Arroz con leche', 1500, 5, , 'El arroz con leche es un postre típico de la gastronomía de múltiples países hecho cociendo lentamente arroz con leche y azúcar.', '190', 'Vigente');
INSERT INTO `platillos` (`Id_Platillo`, `Nombre_Platillo`, `Precio_Platillo`, `Id_Categoria`, `Foto_Platillo`, `Descripcion_Platillo`, `ventas`, `Estado`) VALUES
(8, 'Mazamorra', 2000, 5, , 'Aquí el maíz no solo se usa en las arepas, los tamales o las empanadas; también hay un contundente y delicioso postre que involucra otro de los ingredientes preferidos de los colombianos: la panela. ', '65', 'Vigente');
INSERT INTO `platillos` (`Id_Platillo`, `Nombre_Platillo`, `Precio_Platillo`, `Id_Categoria`, `Foto_Platillo`, `Descripcion_Platillo`, `ventas`, `Estado`) VALUES
(9, 'Aguapanela', 1000, 4, , 'El agua de panela, limonada de panela, agua e’ panela o ‘aguapanela’, como se le conoce comúnmente a esta, una de las bebidas tradicionales de Colombia, es refrescante, energizante y al mismo tiempo, un “remedio” casero para aliviar los días de resfriado.', '100', 'Vigente');
INSERT INTO `platillos` (`Id_Platillo`, `Nombre_Platillo`, `Precio_Platillo`, `Id_Categoria`, `Foto_Platillo`, `Descripcion_Platillo`, `ventas`, `Estado`) VALUES
(10, 'Natilla', 2000, 5, , 'La navidad en Colombia es el evento del año y la oportunidad ideal para reunir a la familia y los amigos durante las noches de la novena, mientras se endulzan las horas con un buen plato de natilla.', '150', 'No Disponible');
INSERT INTO `platillos` (`Id_Platillo`, `Nombre_Platillo`, `Precio_Platillo`, `Id_Categoria`, `Foto_Platillo`, `Descripcion_Platillo`, `ventas`, `Estado`) VALUES
(11, 'Merengón', 2500, 5, , 'Este si es un postre muy colombiano y por eso, infaltable en tu lista. Lo bueno es que lo vas a ver en casi cualquier restaurante, feria gastronómica, panadería o esquina de Colombia. ', '150', 'Vigente');
INSERT INTO `platillos` (`Id_Platillo`, `Nombre_Platillo`, `Precio_Platillo`, `Id_Categoria`, `Foto_Platillo`, `Descripcion_Platillo`, `ventas`, `Estado`) VALUES
(12, 'Cocadas', 1500, 5, , 'Como su nombre lo indica, el principal ingrediente de este postre es el coco, así que también será muy obvio que son típicas de la costa.', '70', 'No Disponible');
INSERT INTO `platillos` (`Id_Platillo`, `Nombre_Platillo`, `Precio_Platillo`, `Id_Categoria`, `Foto_Platillo`, `Descripcion_Platillo`, `ventas`, `Estado`) VALUES
(17, 'Champús colombiano', 2500, 4, , 'Esta bebida, mayormente conocida y consumida en el Valle del Cauca, se prepara con melado de panela, maíz y frutas locales como: lulo, piña o guanábana, clavos de olor y canela al gusto.', '100', 'No Disponible');
INSERT INTO `platillos` (`Id_Platillo`, `Nombre_Platillo`, `Precio_Platillo`, `Id_Categoria`, `Foto_Platillo`, `Descripcion_Platillo`, `ventas`, `Estado`) VALUES
(18, 'Chicha', 1000, 4, , 'Es una de las bebidas tradicionales latinoamericanas, a base de maíz fermentado con azúcar. En Colombia, dependiendo de la región del país se prepara a base de piña o yuca, aunque es propia de la región andina colombiana. Su grado de alcohol, así como su sabor dulce o amargo varía dependiendo del ti', '100', 'Vigente');
INSERT INTO `platillos` (`Id_Platillo`, `Nombre_Platillo`, `Precio_Platillo`, `Id_Categoria`, `Foto_Platillo`, `Descripcion_Platillo`, `ventas`, `Estado`) VALUES
(19, 'Refajo', 2000, 4, , 'Nada más colombiano que un refajo, una bebida que resulta al combinar cerveza con gaseosa, generalmente de sabor kola roja o con la famosa ‘Colombiana’.', '120', 'No Disponible');
INSERT INTO `platillos` (`Id_Platillo`, `Nombre_Platillo`, `Precio_Platillo`, `Id_Categoria`, `Foto_Platillo`, `Descripcion_Platillo`, `ventas`, `Estado`) VALUES
(20, 'Borojo', 1500, 4, , 'A esta bebida se le atribuyen efectos afrodisíacos, al mismo tiempo, propiedades nutricionales y sanadoras. Se trata de un jugo preparado con borojó, una fruta de color morado o marrón (que solo se da en el Chocó), agua, leche, azúcar o panela, vainilla, huevos y hielo.', '200', 'No Disponible');
INSERT INTO `platillos` (`Id_Platillo`, `Nombre_Platillo`, `Precio_Platillo`, `Id_Categoria`, `Foto_Platillo`, `Descripcion_Platillo`, `ventas`, `Estado`) VALUES
(25, 'Salmón con salsa hoisin y de ostras', 30000, 1, , 'Salmón con salsa hoisin y de ostras.', '125', 'Vigente');
INSERT INTO `platillos` (`Id_Platillo`, `Nombre_Platillo`, `Precio_Platillo`, `Id_Categoria`, `Foto_Platillo`, `Descripcion_Platillo`, `ventas`, `Estado`) VALUES
(26, 'Bagre en leche', 25000, 1, , 'Este pescado es una de las especies más comunes en los ríos y lagunas de Colombia, y también son conocidos como peces gato.', '90', 'Vigente');
INSERT INTO `platillos` (`Id_Platillo`, `Nombre_Platillo`, `Precio_Platillo`, `Id_Categoria`, `Foto_Platillo`, `Descripcion_Platillo`, `ventas`, `Estado`) VALUES
(27, 'Filete de trucha al ajillo', 40000, 1, , 'La trucha es una especie de pez semigraso que aporta gran nivel nutricional en nuestro cuerpo además de que su preparación es muy sencilla. Este delicioso pescado abunda en la gastronomía de muchos paises. Por eso, Cocinarte te enseña a preparar truja al ajillo.', '75', 'Vigente');
INSERT INTO `platillos` (`Id_Platillo`, `Nombre_Platillo`, `Precio_Platillo`, `Id_Categoria`, `Foto_Platillo`, `Descripcion_Platillo`, `ventas`, `Estado`) VALUES
(28, 'Desgranado con palmitos y camarón.', 35000, 1, , 'Aprende a preparar esta rápida y deliciosa receta en casa con Cocinarte. Sorprende a tus amigos en un momento especial.', '75', 'Vigente');
INSERT INTO `platillos` (`Id_Platillo`, `Nombre_Platillo`, `Precio_Platillo`, `Id_Categoria`, `Foto_Platillo`, `Descripcion_Platillo`, `ventas`, `Estado`) VALUES
(29, 'Arepa con camarones', 20000, 1, , 'Las tradicionales arepas colombianas se complementan de sabor al ser rellenadas con camarones.', '125', 'Pago');
INSERT INTO `platillos` (`Id_Platillo`, `Nombre_Platillo`, `Precio_Platillo`, `Id_Categoria`, `Foto_Platillo`, `Descripcion_Platillo`, `ventas`, `Estado`) VALUES
